import React from 'react';
import Header from '../header';
import BurgerMenu from '../burger-menu';

export default class App extends React.Component {
    openrr;
    render() {
        this.onBtnHandler = (openrr) => {
            console.log('test');
            openrr = !openrr;
        }
        
        return (
            <div>
                <Header 
                    onBtnClickHandler = {this.onBtnHandler} />
                <BurgerMenu
                    open = {this.onBtnHandler} />
            </div>
        );
    };
};
